import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as d,d as r,a as e,b as a,e as s}from"./app-59055221.js";const o="/assets/imgs/bgs/(15).png",n={},c=e("h1",{id:"考完了-我活了",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#考完了-我活了","aria-hidden":"true"},"#"),a(" 考完了，我活了")],-1),h=e("p",null,[e("s",null,"但是没有完全活")],-1),p=e("h2",{id:"行吧。",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#行吧。","aria-hidden":"true"},"#"),a(" 行吧。")],-1),_=e("p",null,"先放首歌。",-1),l=e("iframe",{frameborder:"no",border:"0",marginwidth:"0",marginheight:"0",width:"330",height:"86",src:"//music.163.com/outchain/player?type=2&id=1922729963&auto=1&height=66"},null,-1),m=s('<h3 id="考试令我放弃自我。" tabindex="-1"><a class="header-anchor" href="#考试令我放弃自我。" aria-hidden="true">#</a> 考试令我放弃自我。</h3><p>为什么我总是在各种正式或非正式的无意义的事情中徘徊？</p><p>无论是网络也好，消磨时间也好，无意义的课程也好，它们让我仿佛陷身于流沙之中，一件一件地无穷无尽的疲于应付；而当我偶尔回首审视自我，却发现原本的自我已经被磨成了齑粉，随时间的风消散，无影无踪。</p><p>还好，我在身体和精神崩溃之前撑过了考试周。</p><figure><img src="'+o+'" alt="好看的" tabindex="0" loading="lazy"><figcaption>好看的</figcaption></figure><h2 id="今天买了个pad。" tabindex="-1"><a class="header-anchor" href="#今天买了个pad。" aria-hidden="true">#</a> 今天买了个pad。</h2><p>开心。</p><p>（于是这篇文章也是拿pad写的， iPad和安卓平板做得到吗！）</p><p>Windows Pad竟然意外地好用， 今天晚上拿它写写文章看。</p><p>虽说是ARM64，但是能在模拟下跑绝大部分日常需要使用的应用，甚至还能跑小红车和PS是我没想到的。</p><p><s>关键是价格还比iPad之流便宜得多，和一个平均水平的安卓pad差不多，这不是大赢？</s></p><p>明天midi键盘也到了。好好好好</p><p><s>怎么考完试就只会说这种没逻辑且莫名其妙的话了</s></p><p>行吧， 睡觉。 希望下学期不要再有这学期一般的阴间课程安排了。</p>',14);function f(u,g){return i(),d("div",null,[c,h,r(" more "),p,_,l,m])}const N=t(n,[["render",f],["__file","20230621.html.vue"]]);export{N as default};
